    <RoomConsumer>
      {(value) => {
        const { loading, sortedRooms, rooms } = value;

        return (
          <div>
            Hello Froms Rooms Container
            <RoomsFilter />
            <RoomsList />
          </div>
        );
      }}
    </RoomConsumer>
  );
}

export default RoomContainer;
